import AddRadio from "./radio/AddRadio";
import RadioList from "./components/Radio/adioList";

export default function Radio() {
  return (
    <div className="radio-component">
      <h1>Radio List</h1>
      <AddRadio />
      <RadioList />
    </div>
  );
}
